            OOOOOOOooooooOoooo = getattr(OOOOOOOooooooOooooOOoooooOOoo, lllllllllllllllllllll)
            
            llllllllllllllllll = self.cartes_joueur["A"][int(self.ooOOoo["llllllllllllA"][self.ooOOooO])]
            lllllllllllllllllllll = self.cartes_joueur["B"][int(self.ooOOoo["llllllllllllB"][self.ooOOooO])]
