            OOOOOOOooooooOo = getattr(OOOOOOOooooooOooooOOoooooOOoo, lllllllllllllllllllll)
            
            
            self.ooOOooO += 1
            if( OOOOOOOooooooOo is None ):
                self.OOOOOOOooooooO()
